@bennyjohnson

I’m all for having fun but this is the Executive Branch of the US Government and this is beyond tone deaf. The Southern Border is a mess, inflation is out of control, we just lost Afghanistan to terrorists who now have American Sniper Rifles, Humvee’s and billions of US gear… and this is our focus? 

China is watching this and licking their lips… wake the F up Biden… this administration is a national embarrassment.

